Program: |+1
 // Stop the conveyor that the part is assumed to be transported on. Next look for a free place within the racks registered in the WMS. 
 // If a free place is found the transport of the part proceeds. If not, wait until another place is free within the racks registered
 // with the WMS and check whether the part is eligible to be stored there. If yes, the transport continues and if not then the 
 //  the method is again suspended until a new place is free.
 var conveyor := ?
 while true
 	conveyor.stopped := true
 	var foundFreePlace : boolean := WMS.placeIntoStock(@)
 	if foundFreePlace
 		conveyor.stopped := false
 		exitLoop
 	else
 		var freeplaces:= WMS.NumFreePlaces
 		waituntil WMS.NumFreePlaces > freeplaces
 	end
 end
